import React from 'react';
import { Box } from '@chakra-ui/react';
import PizzaCard from '../card/pizza';
import pizzaDetails from './pizzaDetails/pizzaDetails.json';

const Main = () => {
  return (
    <Box
      padding="2rem"
      margin="2rem"
      borderRadius="lg"
    >
      <Box display="flex" flexWrap="wrap" justifyContent="center" gap="40px" >
        {pizzaDetails.pizzas.map((pizza, index) => (
          <PizzaCard
            key={index}
            imageSrc={pizza.imageSrc}
            pizzaName={pizza.pizzaName}
            prices={pizza.prices}
            description={pizza.description}
          />
        ))}
      </Box>
    </Box>
  );
};

export default Main;
